import React from 'react'
import ArrowRightIcon from '@mui/icons-material/ArrowRight';
const SideNav = () => {
  return (
    <div>
       <div><h3 className='text-lg font-titleFont font-semibold mb-1 px-6'> Digital Content & Devices</h3>
        <ul><li className='flex items-center justify-between hover:bg-zinc-200 px-6 py-2 cursor-pointer'>Amazon Music {" "} <span><ArrowRightIcon/></span></li>
        <li className='flex items-center justify-between hover:bg-zinc-200 px-6 py-2 cursor-pointer'>Kindle E-reading & Books{" "}<span><ArrowRightIcon/></span></li>
        <li className='flex items-center justify-between hover:bg-zinc-200 px-6 py-2 cursor-pointer'>Amazon Appstore {" "} <span><ArrowRightIcon/></span></li>
        </ul>
        </div>
    </div>
  )
}

export default SideNav
